interface IProps
{
    name:string,
    isCompleted:boolean
}

export default class Exercise {
    name: String;
    isCompleted: Boolean;
    constructor(parameters: IProps) {
        this.name = parameters.name;
        this.isCompleted = parameters.isCompleted;
    }
}
